import React from "react";
import Cart from "../Cart";

const CartPage = ({ cart, removeFromCart, totalAmount }) => {
    return (
        <div>
            <h2>Your Cart</h2>
            <Cart cart={cart} removeFromCart={removeFromCart} totalAmount={totalAmount} />
        </div>
    );
};

export default CartPage;
